import ReactDOM from 'react-dom';
import { ApolloProvider } from '@apollo/client'; // ✅ This is valid in v4.0.3
import App from './App';
import client from './ApolloClient';

ReactDOM.render(
  <ApolloProvider client={client}>
    <App />
  </ApolloProvider>,
  document.getElementById('root')
);
